void vMain_drawCharCorrners(char userInputtedChar);
void vMain_drawCharMiddle(char userInputtedChar);

int main(void)
{
  vMain_Initlize48MHz();
  ST7735_InitR(INITR_REDTAB);

  ST7735_FillScreen(0x0000);
  uint8_t dispChar;
  while(1)
  {
      for(dispChar = 0; dispChar < 10; dispChar++)
      {
          vMain_drawCharCorrners(dispChar + 48);
          __delay_cycles(30000000);
      }

      ST7735_FillScreen(0x0000);

      for(dispChar = 0; dispChar < 10; dispChar++)
      {
          vMain_drawCharMiddle(dispChar + 48);
          __delay_cycles(15000000);
      }

      ST7735_FillScreen(0x0000);

      __delay_cycles(30000000 * 3);
  }
}

void vMain_drawCharCorrners(char userInputtedChar)
{
    ST7735_DrawCharS(0, 0, userInputtedChar, 0xFFFF, 0x0000, 4); // upper left
    ST7735_DrawCharS(110, 0, userInputtedChar, 0xFFFF, 0x0000, 4); // upper right
    ST7735_DrawCharS(0, 130, userInputtedChar, 0xFFFF, 0x0000, 4); // lower left
    ST7735_DrawCharS(110, 130, userInputtedChar, 0xFFFF, 0x0000, 4); // lowe right
}

void vMain_drawCharMiddle(char userInputtedChar)
{
    ST7735_DrawCharS(55, 65, userInputtedChar, 0xFFFF, 0x0000, 4);
}

